import React,{Component} from 'react';
import './App.css';

class Items extends Component {

  render () {
    const {items,onChange} = this.props;
    return <li>
      <label>
        <input type="checkbox" name="name" onChange={() => onChange(items.id)}
               checked={items.checked}/>
        {items.label}
      </label>
    </li>
  }
}

export default Items;
